        public CommonJsonModel DeSerialize(string json)
        {
            return new CommonJsonModel(json);
        }

        private void GetModel(string jsonStr)
        {
            JavaScriptSerializer jscvt = new JavaScriptSerializer();
            //将json字符串转变成指定类型对象
            DataPackVO model = jscvt.Deserialize<DataPackVO>(jsonStr);
            Response.Write(model.Version);
            //将对象转变成json字符串
            string objstr = jscvt.Serialize(model);
            Response.Write(objstr);
            //将JSON转变成object对象
            object obj = jscvt.DeserializeObject(jsonStr);
            //将给定对象转换成指定类型
            DataPackVO man = jscvt.ConvertToType<DataPackVO>(obj);
            Response.Write(man.Version);
        }

